import React from 'react';
import Searchbar from '../search/searchbar';
import Banner from '../banner/index';
const GuestHomePage = () => {
  return (
    <div className="mt-3">
      <header>
        <div className="d-flex justify-content-between align-items-center">
          <h1 className="" style={{  display:"inline"}}>Travel__</h1>
          <button className="btn btn-outline-secondary rounded-pill" style={{display: "inline-block", float: "right"}}>Sign in</button>
        </div>
        <div style={{display: 'flex',  justifyContent:'center', alignItems:'center'}} className="mt-4">
          <Searchbar />
        </div>
      </header>
      {/* <main>
        <p style={{textAlign: "center"}}>Book your next adventure now!</p>
      </main> */}
    </div>
  );
}

export default GuestHomePage;
